import React from 'react';
import './Home.css';

const Home = () => {
  return (
    <section id="home" className="home">
      {/* Responsive arka plan resmi */}
      <img 
        src="../components/law-background.jpg" 
        alt="Background Image" 
        className="responsive-image" 
      />
      
      {/* İçerik başlığı */}
      
    </section>
  );
};

export default Home;
